import ReactDOM from 'react-dom';
import App from './App';
import './App.css';
import CategoryPopup from "./components/CategoryPopup"
import {selectedWord} from "./components/CategoryPopup"


ReactDOM.render(
  <React.StrictMode>
  <div className="game-container">
  <CategoryPopup />
  </div>
    <App selectedWord={selectedWord}/>
  </React.StrictMode>,
  document.getElementById('root')
);
